Created to pester the Swamp Thing yea-many years back, the Un-Men are surgically created freaks now receiving their second spin-off (after a five-issue comic in 1994) at Whalen and HawthorneÃ¢â‚¬â„¢s enthusiastic hands. Cranius (a face-and-bulging-brain atop a hand, which perches on a supersurgeon body, Otto) and Janus (an extra head and smaller torso sprout from his back) have seized corporate control of Aberrance U.S.A., a city reservation-cum-theme park for the very differently abled that was founded by the late (sort of, it develops) Damien Kane, whom cancer experimentation made elephant-man-like. The citizenry is restless, and after albino agent Kilcrop comes to investigate the murder of dissident Berthold the Amazing Gill-Boy, all hell breaks loose-and just as Cranius as, atop Otto, Dr. Von Schadel is set to launch his surefire-hit reality show, American Freak. A verbal and visual stream of gross-outs, gunplay, gore, grimaces, un-PC guffaws, and heroics executed with an oh-puh-leez! attitude, this is immense over-the-top fun, perfect for a movie with Jim Carrey as everybody except Niko, the one-armed, two-winged love interest.
